sys_variable_value.value:
(function execute(inputs, outputs) {
    var array = [];
      function iterateQuestionnaire(qArr) {
           // gs.error("qwert " + JSON.stringify(qArr));
            if (qArr) {
              //  gs.error("sdfg " + JSON.stringify(qArr));
                iterateQuestions(qArr);
            }
        }
                function iterateQuestions(questions) {
            questions.forEach(function (question) {
                if (question.subQuestion && question.subQuestion.length > 0) {
                    question.subQuestion.forEach(function (subQuestion) {
                        if (subQuestion.questionAnswer === "N") {
                            var obj = {
                                "stringval1": question.questionID,
                                "stringval2": subQuestion.questionID,
                                "stringval3": subQuestion.questionAnswer,
                                "stringval4": "",
                                "stringval5": question.ipType,
                                "stringval6": subQuestion.questionFlag
                            };
                                          //  gs.error("insideloop" + JSON.stringify(obj));
                           // gs.info(JSON.stringify(obj));
                            array.push(obj);
                        }
                    });

                    iterateQuestions(question.subQuestion);
                }
            });
        }
    try {
        if (!inputs.questionaire || !inputs.questionaire.questionaire) {
        }
        var qArr = inputs.questionaire.questionaire.questionaireList;
        iterateQuestionnaire(qArr);
       // gs.error("hiiii " + JSON.stringify(qArr));

        outputs.questionairearr = {};
        var questionairearr = {
            "WeoRecStrings150User": array
        };
//gs.info(JSON.stringify(questionairearr));
        outputs.questionairearr = questionairearr;
    } catch (error) {
        gs.error("Error: " + error.message);
    }
})(inputs, outputs);

